#include <string.h>
void fill_brsfc_int(char *ptr, int *dest, int n)
{
  void *sptr, *dptr;
  int i;

  sptr = (void *)ptr; dptr = (void *)dest;
  for (i=0; i<n; i++) {
    memcpy(dptr, sptr, SIZEOF_int);
    sptr += SIZEOF_int;
    dptr += sizeof(int);
  }
}
