void fill_brsfc_ptrdiff_t(char *src, ptrdiff_t *dest, int n)
{
  char *sptr;
  ptrdiff_t *dptr;
  int i;

  sptr = src; dptr = dest;
  for (i=0; i<n; i++) {
#ifdef SIZEOF_long_int
    fill_brsfc_long_int(sptr, (long int *)dptr, 1);
#endif

    dptr += 1;

    sptr += SIZEOF_ptrdiff_t;
  }
}
